static inline bool sym_escape_sequence_character_set_1(int32_t c) {
  return (c < 'l'
    ? (c < 'a'
      ? (c < '\''
        ? c == '"'
        : (c <= '\'' || c == '\\'))
      : (c <= 'a' || (c < 'e'
        ? c == 'c'
        : c <= 'f')))
    : (c <= 'l' || (c < 'r'
      ? (c < 'p'
        ? c == 'n'
        : c <= 'p')
      : (c <= 'r' || (c < 'v'
        ? c == 't'
        : c <= 'v')))));
}

